import React from "react";

import '../assets/css/Login.css'
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';

import axios from 'axios'


function Login() {

  function SendHome(e) {
    e.preventDefault();
    window.location.href = "/"

  }
  function SendSignUp(e) {
    e.preventDefault();
    window.location.href = "/signup"

  }

  function SendData(e) {
    e.preventDefault();
    console.log(e);
    console.log(e.target['0'].value);
    console.log(e.target['1'].value);

    const formData = new FormData();
    const email = e
      .target['0']
      .value;
    const pwd = e
      .target['1']
      .value;

    formData.append("email", email);
    formData.append("pwd", pwd);

    axios({ url: 'http://localhost:8080/user/signIn', method: 'post', data: formData }).then(
      function (res) {
        console.log(res.data);

      }
    )
  }


  return (

    <>
      <div id="ls-2">
        <div class="background_1">

          {/* <img src={Collage}></img> */}
          <div className="container">
            <div className="L-1">
              <div className="card">
                <div className="cardform">
                  <h1 className="title">Welcome to Cookub!!</h1>
                  <p className="subtitle">Happy Cooking!!</p>
                  <br />
                  <form onSubmit={SendData}>

                    <Box
                      component="form"
                      sx={{
                        '& > :not(style)': { m: 0.5, width: '30ch' },
                      }}
                      noValidate
                      autoComplete="off"
                    >
                      <TextField id="outlined-basic" label="Email" variant="outlined" />
                      <TextField
                        id="outlined-password-input"
                        label="Password"
                        type="password"
                        autoComplete="current-password"
                      />
                    </Box>

                    <br />

                    <Stack id="Btn-1" spacing={8}>
                      <Button variant="outlined" onClick={SendHome}>Submit</Button>
                      <Button variant="outlined" onClick={SendSignUp}>SignUp</Button>
                    </Stack>
                  </form>
                </div>


              </div>


            </div>



          </div>

        </div>

      </div>

    </>

  );
}

export default Login;
